import '../StyleCSS/Reviews.css';



function Reviews(){
    return(
        <div className='review-page'>
            <div className="review-page-container">
                <div className='review-page-heading'>Reviews of this person</div>
<div className='review-page-selectorbox'>
    <div className='review-page-selectorbox__element'><p>Rating <i class="arrow down"></i></p></div>
    <div className='review-page-selectorbox__element'><p>Year<i class="arrow down"></i></p></div>
    <div className='review-page-selectorbox__element'>When Reviewed</div>

</div>
                
            </div>
        </div>
    )

}

export default Reviews;
